import React, { Component } from 'react';
class Header extends Component {




    render() {
        const banner = require('../images/jb_banner.png');


        return (

            <div>
                <div class="container">

                    <div className="row">
                        <div class="col-sm-12 col-md-12 col-col-lg-12 header centered">
                        {/* <img src="src/images/jb banner.png"> */}
                        <img resizeMode="contain" src={banner} alt="banner"></img>

                        </div>


                    </div>
                </div>
            </div>
        )
    }
}
export default Header;
